import React, { useEffect, useState } from "react";
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import Container from '@mui/material/Container';
import Paper from '@mui/material/Paper';
import Box from '@mui/material/Box';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Avatar from '@mui/material/Avatar';
import ButtonGroup from '@mui/material/ButtonGroup';
import { Link } from "react-router-dom";
import ButtonAppBar from '../Component/Nav';
import Axios from 'axios';
import { useNavigate } from 'react-router-dom';
import Swal from 'sweetalert2';
import Modal from '@mui/material/Modal';

export  function DashboardIn() {
  const [users, setUsers] = useState([]);
  const [sresult, setsResult] = useState('');
  const [result, setResult] = useState('');
  const history = useNavigate();
  useEffect(() => {
    UsersGet()
    //console.log(profile);
  }, [])

  const [isModalOpen, setIsModalOpen] = useState(false);

  const handleAddButtonClick = () => {
    setIsModalOpen(true);
  };

  const UsersGet = () => {
    Axios.get("http://localhost:3001/api/topInteract")
      .then(response => {
        setUsers(response.data);
      })
      .catch(error => {
        console.log(error);
      });
  };

  const UpdateUser = id => {
    console.log("rid" + id);
    const link = '/updateInteract/'+id;
    //history('/updateSuggest/${id}');
    history(link);
  }

  const UserDelete = id => {
    Axios.post('http://localhost:3001/api/deleteInteract', {
      'rid' : id,
    }).then((respond) => {
      console.log(respond.data);
      setsResult(respond.data);
      console.log(id);
      Swal.fire({
        icon: "success",
        title: "Success",
        text: result.message,
      });
      UsersGet();
    }).catch((error) => {
      console.error(error);
      Swal.fire({
        icon: "error",
        title: "Error",
        text: result.message,
      });
    });
  }

  return (
    <div>
      <ButtonAppBar />
      <Container sx={{ p: 2 }} maxWidth="lg">
        <Paper sx={{ p: 2 }}>
          <Box display="flex">
            <Box flexGrow={1}>
              <Typography component="h2" variant="h6" color="primary" gutterBottom>
                Interaction
              </Typography>
            </Box>
            <Box>
              <Button variant="contained" color="primary" onClick={handleAddButtonClick}>
                Add
              </Button>
            </Box>
          </Box>
          <TableContainer component={Paper}>
            <Table aria-label="simple table">
              <TableHead>
                <TableRow>
                  <TableCell align="right">ID</TableCell>
                  <TableCell align="center">Drug Name</TableCell>
                  <TableCell align="left">Drug Name</TableCell>
                  {/* <TableCell align="left">Last</TableCell> */}
                  <TableCell align="center">Severity level</TableCell>
                  <TableCell align="center">Modification</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {users.map((user) => (
                  <TableRow key={user.DDi_id}>
                    <TableCell align="right">{user.DDi_id}</TableCell>
                    {/* <TableCell align="center">
                      <Box display="flex" justifyContent="center">
                        <Avatar src={user.avatar} />
                      </Box>
                    </TableCell> */}
                    <TableCell align="center">{user.drug1}</TableCell>
                    <TableCell align="left">{user.drug2}</TableCell>
                    <TableCell align="center">{user.level}</TableCell>
                    <TableCell align="center">
                      <ButtonGroup color="primary" aria-label="outlined primary button group">
                        <Button onClick={() => UpdateUser(user.rid)}>Edit</Button>
                        <Button onClick={() => UserDelete(user.rid)}>Del</Button>
                      </ButtonGroup>
                    </TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </TableContainer>
        </Paper>
      </Container>
      <Modal
        open={isModalOpen}
        onClose={() => setIsModalOpen(false)}
        aria-labelledby="add-interaction-modal-title"
        aria-describedby="add-interaction-modal-description"
      >
        <Box sx={{ position: 'absolute', top: '50%', left: '50%', transform: 'translate(-50%, -50%)', width: 400, bgcolor: 'background.paper', boxShadow: 24, p: 4 }}>
          <Typography id="add-interaction-modal-title" variant="h6" component="h2" gutterBottom>
            Add Interaction
          </Typography>
          {/* Add your form elements here */}
        </Box>
      </Modal>
    </div>


  );
}
